import React, {Component, Fragment} from 'react';
import Board from './Board.js';

class App extends Component {
    constructor() {
        super();
        this.state = {
            stan: 0
        }
    }
    render() {
        return(
            <Fragment>
                <div className='game-header-container'><h1 id='game-header'>TIC-TAC-TOE</h1></div>
                <Board />
            </Fragment>
        )
    }

}

export default App;
